

pb = [";"]

import numpy as np

from agl.python.subgraph.subgraph import PySubGraph
from pyagl.pyagl import AGLDType, DenseFeatureSpec, SparseKVSpec, SparseKSpec, NodeSpec, EdgeSpec, SubGraph, NDArray

# node related spec
node_spec = NodeSpec("default", AGLDType.STR)
node_spec.AddSparseKVSpec("sparse_kv", SparseKVSpec("sparse_kv", 1901, AGLDType.INT64, AGLDType.FLOAT))
# edge related spec
edge_spec = EdgeSpec("default", node_spec, node_spec, AGLDType.STR)
edge_spec.AddSparseKVSpec("sparse_kv", SparseKVSpec("sparse_kv", 1, AGLDType.INT64, AGLDType.FLOAT))

sg = PySubGraph([node_spec], [edge_spec])

pbs = pb[0].split(";")
gf = pbs[0].encode('utf-8')

pb_string_double = [bytearray(gf)]
sg.from_pb_bytes(pb_string_double)

n_spk = sg.get_node_sparse_k_feature("default", "sparse_kv")
print(f"node feature: {n_spk} ")
